import Link from "next/link";
import Head from "next/head";
import Layout from "../components/layout";


export default function HomePage({children}){
  return(
    <Layout>
      <Head>
        <title>Shopping Card</title>
      </Head>
      <div>
        {children}
      </div>
    </Layout>
  )
}
